Colouration in life (
Fig. 1
). Basic colour of dorsal surface of head, upper part of flank, back and dorsal surfaces of extremities light brown; snout, loreal region and anterior part of eyelids orange brown; snout with median longitudinal black spot; black inter-orbital bar; back with irregular darker patterning; lower arms, thighs, lower legs and feet with dark crossbars; anterior part of upper mandible brown with a dark bar; a V-shaped darker figure in scapular region, pointing anteriorly; black lateral face mask extending from below the eye and supratympanic ridge to forearm bases, covering tympanum; continuing below arms as a lateroventral black patch to axillar region; eye posterodorsally bordered by fine blue line; black pupil; iris copper red; central belly dirty white; belly laterally and pectoral area dark grey, no distinct black ventrolateral line or band; ventral part of forelimbs and hands dark grey; groin area and lower surfaces of thighs, lower leg and tarsus yellowish to orange; lower part of lower legs bordered by blackish spots; ventral surfaces of toes blackish.
